import "./css/Footer.css"


function Footer() {
  return (
    <footer>

      <ul className="footer_list footer_social">
        <li> <a href="/mouse.html">private policy</a></li>
        <li> <a href="/dogs.html">cantact</a></li>
        <li> <a href="/elephants.html">elephants</a></li>
        <li> <a href="/bird.html">bird</a></li>
        <li> <a href="/duck.html">duck</a></li>
      </ul>

      <div>private policy</div>
      <div>©melchiott‘s bakery</div>
      <div>This image is copyright protected under UK copyright Law. </div>

    </footer>
  );
}

export default Footer;
